-- 导出  存储过程 testdb.insert_data 结构
DELIMITER //
CREATE PROCEDURE `insert_data`(
	OUT `cnt` INT,
	OUT `err` VARCHAR(50)
)
BEGIN
/* INSERT INTO isbn(zlibrary_id,isbn,content,title) VALUES(2,2,'test2','test2');*/
	declare code INT DEFAULT 25;
	declare seq INT DEFAULT 0;
	declare name VARCHAR(10) DEFAULT 'Test';
	  
	declare id INT(10);
	declare isbn_v VARCHAR(13);
	declare content_v VARCHAR(13);
	declare title_v VARCHAR(50);
	
   declare sum_cnt INT(10);
   declare loop_i INT(10) DEFAULT 0;
   
   declare hasSqlError int DEFAULT FALSE;
   declare emp_flag cursor FOR select zlibrary_id, isbn, content, title from isbn;
   declare CONTINUE HANDLER FOR SQLEXCEPTION SET hasSqlError=TRUE;
   
  	while CODE <= 29 do
  	   SELECT insert_seq(20) INTO seq;
      set CODE = CODE + 1;
	end while;

	select COUNT(zlibrary_id) INTO sum_cnt from isbn;
	 
	open emp_flag;
	
	c:loop
	 	  if loop_i >= sum_cnt then
	 	      leave c;
	 	  end if;
        fetch emp_flag into id, isbn_v, content_v, title_v;
        set loop_i = loop_i + 1;
        select id, isbn_v, content_v, title_v;
        IF hasSqlError THEN
		      ROLLBACK;
		      leave c;
		  END IF;
   end loop;
	close emp_flag;
	COMMIT;
   SET cnt = loop_i;
   SET err := hasSqlError;
END//
DELIMITER ;

-- 导出  函数 testdb.insert_seq 结构
DELIMITER //
CREATE FUNCTION `insert_seq`(
	`p1` INT
) RETURNS int
    READS SQL DATA
    COMMENT 'test'
BEGIN
   declare cnt INT DEFAULT 0;
	SELECT COUNT(*) INTO cnt FROM isbn;
	set cnt = cnt + p1;
   RETURN cnt;
END//
DELIMITER ;

