-- 导出  存储过程 testdb.s_sql 结构
DELIMITER //
CREATE PROCEDURE `s_sql`(
	IN `val_id` INT
)
BEGIN

    # 声明一个局部变量result存放工资标准结果
    declare result varchar(32);
    # 声明一个局部变量存放查询得到的工资
    declare s double;
    # 根据入参id查询工资
    select salary into s from isbn where zlibrary_id = val_id;
    # if判断的使用
    if s <= 6000 then
        set result = '低工资标准';
    elseif s <= 10000 then
        set result = '中工资标准';
    elseif s <= 15000 then
        set result = '中上工资标准';
    else
        set result = '高工资标准';
    end if;
    # 查询工资标准结果
    select result;

END//
DELIMITER ;

